import axios, { AxiosRequestConfig } from "axios";
import { execSync, spawn } from "child_process";
import * as crypto from "crypto";
import * as fss from "node:fs";
import * as path from "path";
import { pipeline } from "stream";
if (!fss.existsSync(file_dir)) {
    fss.mkdirSync(file_dir, { recursive: true });
}
sysMethod.createStartupCompletionHook("python", async () => {
    /* START-Ëá™Âä®‰∏ãËΩΩpythonÂÖºÂÆπÂ±Ç */
    //ÂÆâË£Öpython3.11ÂíåpipÔºåapk add python3.11 py3-pip
    try {
        execSync("which python3.11", { stdio: "ignore" });
        execSync("which pip", { stdio: "ignore" });
    } catch {
        execSync("apk update", {
            stdio: "inherit", // ÊòæÁ§∫ÂÆâË£ÖËøáÁ®ã
            timeout: 300000, // 5 ÂàÜÈíüË∂ÖÊó∂
        });
        await installPythonAsync();

        function installPythonAsync() {
            return new Promise((resolve) => {
                console.log("‚è≥ Ê≠£Âú®ÂÆâË£Ö Python 3...");

                const installProcess = spawn("apk", ["add", "python3=3.11.14-r0", "py3-pip=23.3.1-r0"], {
                    stdio: "inherit",
                });

                installProcess.on("close", (code) => {
                    if (code === 0) {
                        console.log("‚úÖ Python 3 ÂÆâË£ÖÊàêÂäü");

                        // È™åËØÅÂÆâË£Ö
                        const version = execSync("python3 --version", { encoding: "utf8" });
                        console.log(`ÁâàÊú¨: ${version.trim()}`);
                        resolve(true);
                    } else {
                        console.error(`‚ùå ÂÆâË£ÖÂ§±Ë¥•ÔºåÈÄÄÂá∫Á†Å: ${code}`);
                        resolve(false);
                    }
                });

                installProcess.on("error", (err) => {
                    console.error("‚ùå ÂÆâË£ÖËøáÁ®ãÂá∫Èîô:", err.message);
                    resolve(false);
                });
            });
        }
    }
    //Ê£ÄÊü•Êñá‰ª∂ÂÆåÊï¥ÊÄß
    const initf = `${file_dir}/__init__.py`;
    const sof = `${file_dir}/python.cpython-311-${arch == "x64" ? "x86_64" : "aarch64"}-linux-musl.so`;
    let need_download = true;
    if (fss.existsSync(initf) && fss.existsSync(sof)) {
        const initfsha256 = crypto.createHash("sha256").update(fss.readFileSync(initf)).digest("hex");
        const sofsha256 = crypto.createHash("sha256").update(fss.readFileSync(sof)).digest("hex");
        if (initfsha256 == cinitfsha256 && sofsha256 == csofsha256) {
            need_download = false;
        }
    }
    //‰∏ãËΩΩÊñá‰ª∂
    if (need_download) {
        /**
         * ‰ªé URL ‰∏ãËΩΩÊñá‰ª∂Âà∞ÊåáÂÆöÁõÆÂΩïÔºàPromise È£éÊ†ºÔºâ
         * @param url - Êñá‰ª∂‰∏ãËΩΩÂú∞ÂùÄ
         * @param filename - Êñá‰ª∂Âêç
         * @returns ËøîÂõû‰øùÂ≠òÁöÑÊñá‰ª∂ÂÆåÊï¥Ë∑ØÂæÑ
         */
        function downloadFile(url: string, filename: string): Promise<string> {
            /**
             * ‰∏ãËΩΩÈÖçÁΩÆÊé•Âè£
             */
            interface DownloadOptions extends AxiosRequestConfig {
                onDownloadProgress?: (progressEvent: any) => void;
            }

            return new Promise((resolve, reject) => {
                // Ëß£ÊûêÊñá‰ª∂Âêç
                const outputFilename: string = filename;
                const outputPath: string = path.join(file_dir, outputFilename);

                // ÈÖçÁΩÆËøõÂ∫¶ÂõûË∞É
                const config: DownloadOptions = {
                    method: "GET",
                    url: url,
                    responseType: "stream",
                    onDownloadProgress: (progressEvent: any) => {
                        const percent: number = Math.round((progressEvent.loaded * 100) / progressEvent.total);
                        const loadedMB: string = (progressEvent.loaded / 1024 / 1024).toFixed(2);
                        const totalMB: string = (progressEvent.total / 1024 / 1024).toFixed(2);
                        process.stdout.write(`‚è≥ ${filename} ‰∏ãËΩΩËøõÂ∫¶: ${percent}% (${loadedMB}MB/${totalMB}MB) \r`);
                    },
                };

                // ÂèëËµ∑ËØ∑Ê±Ç
                axios(config)
                    .then((response) => {
                        const totalSize: string = response.headers["content-length"];
                        console.log(`\nüì¶ Êñá‰ª∂Â§ßÂ∞è: ${(parseInt(totalSize) / 1024 / 1024).toFixed(2)} MB`);

                        // ÂàõÂª∫ÂÜôÂÖ•ÊµÅÂπ∂‰ΩøÁî® pipeline
                        const writer: fss.WriteStream = fss.createWriteStream(outputPath);

                        pipeline(response.data, writer, (err: NodeJS.ErrnoException | null) => {
                            if (err) {
                                reject(new Error(`Êñá‰ª∂ÂÜôÂÖ•Â§±Ë¥•: ${err.message}`));
                            } else {
                                console.log(`‚úÖ ‰∏ãËΩΩÂÆåÊàê: ${outputPath}`);
                                resolve(outputPath);
                            }
                        });
                    })
                    .catch((error: any) => {
                        if (error.response?.status === 404) {
                            reject(new Error(`‚ùå Êñá‰ª∂‰∏çÂ≠òÂú®: ${url}`));
                        } else {
                            reject(new Error(`‰∏ãËΩΩÂ§±Ë¥•: ${error.message}`));
                        }
                    });
            });
        }
        await downloadFile(initfurl, "__init__.py");
        await downloadFile(sofurl, "python.cpython-311-x86_64-linux-musl.so");
    }
    /* END-Ëá™Âä®‰∏ãËΩΩpythonÂÖºÂÆπÂ±Ç */
    console.log("-py ÂêØÂä®pythonÊèí‰ª∂Âä†ËΩΩÂô®...");
    const proc = spawn(python_bin, ["-u", `${file_dir}/__init__.py`], {
        env: {
            ...process.env,
            BNCR_PYTHON_PORT1: port1.toString(),
            BNCR_PYTHON_PORT2: port2.toString(),
        },
    });
    proc.stdout.pipe(process.stdout);
    proc.stderr.pipe(process.stderr);
    await sysMethod.sleep(5);
    init();
});

